import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return props.items.map((ExpItem) => {
    <div>
      <ExpenseItem
        title={ExpItem.title}
        amount={ExpItem.amount}
        date={ExpItem.date}
      />
      <div>hi</div>
    </div>;
  });
}

export default Expenses;
